import styles from "./Layout.module.css";
import Container from "./Container";

export default ({ children }) => (
  <Container>
    <div className={styles.layout}>
      {children.map(child => (
        <div className={styles["item-wrapper"]}>{child}</div>
      ))}
    </div>
  </Container>
);
